import styles from "../styles/Sidebar.module.css";

import Dashboard from "../icons/dashboard.svg";
import Spending from "../icons/spending.svg";
import { ReactComponent as DeathStarIcon } from "../icons/death_star.svg";
import { ReactComponent as PearIcon } from "../icons/pear_logo.svg";

const Sidebar = (props) => {
  return (
    <div className={styles["sidebar"]}>
      <nav className={styles["sidebar-nav"]}>
        <ul>
          <li>
            <a href="#">
              <div className={styles["svg-viewbox"]}>
                <img src={Dashboard} alt="React Logo" height="40px" />
              </div>
              <span>Dashboard</span>
            </a>
          </li>

          <li>
            <a href="#">
              <div className={styles["svg-viewbox"]}>
                <img
                  src="https://www.svgrepo.com/svg/428454/circle-plus"
                  alt="React Logo"
                  height="100px"
                />
              </div>
              <span>Spending</span>
            </a>
          </li>
        </ul>
      </nav>
    </div>
  );
};

export default Sidebar;
